import React, { Component } from 'react';

class AssidBar extends Component {
  render() {
    return (
      <div>
        <div className='d-flex flex-column justify-content-center'>
          <nav className='position-fixed start-0'>
            <ul className='list-group gap-3'>
              <li><a href='#home' className='nav-link scrollto'><i className='bi bi-house-door h3'></i> <span className='d-none'>Home</span></a></li>
              <li><a href='#about' className='nav-link scrollto'><i className='bi bi-person h3'></i> <span className='d-none'>About</span></a></li>
              <li><a href='#resume' className='nav-link scrollto'><i className='bi bi-file-earmark h3'></i> <span className='d-none'>Resume</span></a></li>
              <li><a href='#project' className='nav-link scrollto'><i className='bi bi-globe h3'></i> <span className='d-none'>Project</span></a></li>
              <li><a href='#services' className='nav-link scrollto'><i className='bi bi-hdd-stack h3'></i> <span className='d-none'>Services</span></a></li>
              <li><a href='#contact' className='nav-link scrollto'><i className='bi bi-envelope h3'></i> <span className='d-none'>Contact</span></a></li>
            </ul>
          </nav>
        </div>

        <div className='position-fixed bottom-0 end-0'>
          <a href='#home' className='nav-link scrollto'><i className='bi bi-arrow-up-circle h1'></i></a>
        </div>
      </div>
    );
  }
}

export default AssidBar;
